import React from 'react';


function Card(props) {
  const { handleClick, clicked, id } = props
  return (
    <div className="card" style={imgStyle} value={id}>
      <div className="img-container">
        <img 
        onClick={handleClick}
        selected={clicked}
        alt={props.name} 
        src={props.image} />
      </div>
    </div>
  );
}

const imgStyle ={
  padding: 0
}
export default Card;
